import Home from './pages/Home.js';
import SignUp from './pages/SignUp.js';
import Login from './pages/LogIn.js';
import New from './pages/New.js'
import ShoesDetail from './pages/shoes_detail.js';
import About from './pages/About.js'

import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { ProductProvider } from './compenents/ProductContext';

function App() {
  return (
    <Router>
      <ProductProvider>
      <div className="App">
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/SignUp">
            <SignUp />
          </Route>
          <Route path="/LogIn">
            <Login />
          </Route>
          <Route path="/New">
            <New />
          </Route>
          <Route path="./pages/shoes_detail"> 
            <ShoesDetail />
          </Route>
          <Route path="/About"> 
            <About />
          </Route>
          <Route path="/Home"> 
            <Home />
          </Route>
        </Switch>
      </div>
      </ProductProvider>
    </Router>
  );
}

export default App;
